import React from 'react';
import '../styles/analytics.css';

const Analytics = () => {
  return (
    <div className="analytics-container">
      <h2>Сравнительный анализ подразделений</h2>
      <div className="selectors">
        <select>
          <option>ПСЧ-1</option>
          <option>ПСЧ-2</option>
        </select>
        <select>
          <option>ПСЧ-3</option>
          <option>ПСЧ-4</option>
        </select>
        <button className="primary-btn">Сравнить</button>
      </div>

      <div className="charts-container">
        <div className="chart-placeholder">График 1: Эффективность</div>
        <div className="chart-placeholder">График 2: Время реакции</div>
        <div className="chart-placeholder">График 3: Подготовка</div>
        <div className="chart-placeholder">График 4: Количество задач</div>
      </div>
    </div>
  );
};

export default Analytics;
